var postModule=angular.module("post",["app.config"]);postModule.factory("PostService",function(n,t){function r(n){return i.post(n)}function u(){var i=t.one(n.posts);return i.get()}function f(i){var r=t.one(n.postsById+"(PostId="+i+")");return r.get()}function e(i){var r=t.one(n.postsByUserId+"(UserId="+i+")");return r.get()}var i=t.all(n.addPost);return{addPost:r,getPostById:f,getPosts:u,getPostsByUserId:e}});postModule.controller("PostController",function(n,t){n.posts=t.getPosts();n.getPostById=function(n){return t.getPostById(n)};n.addPost=function(n){return t.addPost(n)}});